// contracts/TransactionLogger.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TransactionLogger {
    struct Transaction {
        uint step;
        string txType;
        uint amount;
        string nameOrig;
        uint oldbalanceOrg;
        uint newbalanceOrig;
        string nameDest;
        uint oldbalanceDest;
        uint newbalanceDest;
        bool isFraud;
        bool isFlaggedFraud;
        uint timestamp;
    }

    Transaction[] public transactions;

    event TransactionRecorded(uint transactionId, bool isFraud, bool isFlaggedFraud);

    function recordTransaction(
        uint _step,
        string memory _txType,
        uint _amount,
        string memory _nameOrig,
        uint _oldbalanceOrg,
        uint _newbalanceOrig,
        string memory _nameDest,
        uint _oldbalanceDest,
        uint _newbalanceDest,
        bool _isFraud,
        bool _isFlaggedFraud
    ) public returns (uint) {
        transactions.push(Transaction({
            step: _step,
            txType: _txType,
            amount: _amount,
            nameOrig: _nameOrig,
            oldbalanceOrg: _oldbalanceOrg,
            newbalanceOrig: _newbalanceOrig,
            nameDest: _nameDest,
            oldbalanceDest: _oldbalanceDest,
            newbalanceDest: _newbalanceDest,
            isFraud: _isFraud,
            isFlaggedFraud: _isFlaggedFraud,
            timestamp: block.timestamp
        }));

        uint transactionId = transactions.length - 1;
        emit TransactionRecorded(transactionId, _isFraud, _isFlaggedFraud);
        return transactionId;
    }

    function getTransaction(uint _transactionId) public view returns (Transaction memory) {
        require(_transactionId < transactions.length, "Transaction does not exist.");
        return transactions[_transactionId];
    }

    function getAllTransactions() public view returns (Transaction[] memory) {
        return transactions;
    }
}
